import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './pages/Home';
import About from './pages/About';
import Login from './pages/Login';
import Register from './pages/Register';
import UserHome from './pages/UserHomePage';  // Import UserHome
import ProtectedRoute from './components/ProtectedRoute';  // Import ProtectedRoute
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <header>
          <h1>BukSU Lost and Found System</h1>
          <nav>
            <ul>
              <li><a href="/">Home</a></li>
              <li><a href="/about">About</a></li>
              <li><a href="/login">Login</a></li>
              <li><a href="/register">Register</a></li>
            </ul>
          </nav>
        </header>

        <main>
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/about" element={<About />} />
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />
            <Route path="/user-home" element={<UserHome />} />  {/* Add the route for UserHome */}
            {/* Protect the /user-home route */}
            <Route path="/user-home" element={<ProtectedRoute element={<UserHome />} />} />
          </Routes>
        </main>

        <footer>
          <p>&copy; 2024 BukSU Lost and Found System</p>
        </footer>
      </div>
    </Router>
  );
}

export default App;
